import React from 'react';

import MenuIcon from './MenuIcon';
import FunctionIcon from './FunctionIcon';

const Nav = ({ active, setActive }) => {
    return (
        <div className="nav-container">
            <h1>Arturo Rugh</h1>
            <div className="nav-buttons">
                <div>
                    <FunctionIcon />
                </div>
                <MenuIcon
                    active={active}
                    setActive={setActive}
                />
            </div>
        </div>
    )
}

export default Nav;
